let curRow = 0;
let curCol = input[0].findIndex(v => v === '.');
let curDir = 0;

const changeDir = (dir) => {
    if (dir === 'L'){
        curDir = ((curDir - 1) + 4) % 4;
    } else {
        curDir = (curDir + 1) % 4;
    }
};

const drawMap = () => {
    const lines = [];
    for (const row of input){
        lines.push(row.join(''));
    }
    for (const line of lines) console.log(line);
}

const moveDown = (amt) => {
    let moves = amt;
    while (moves > 0){
        let temp = curRow + 1;
        if (temp > input.length - 1) temp = 0;
        while (input[temp][curCol] === ' ') temp = (temp + 1 > input.length - 1) ? 0 : temp + 1;
        if (input[temp][curCol] === '#') break;
        curRow = temp;
        moves--;
    }
};

const moveUp = (amt) => {
    let moves = amt;
    while (moves > 0){
        let temp = curRow - 1;
        if (temp < 0) temp = input.length-1;
        while (input[temp][curCol] === ' ') temp = (temp - 1 < 0) ? input.length - 1 : temp - 1;
        if (input[temp][curCol] === '#') break;
        curRow = temp;
        moves--;
    }
};

const moveLeft = (amt) => {
    let moves = amt;
    while (moves > 0){
        let temp = curCol - 1;
        if (temp < 0) temp = input[curRow].length-1;
        while (input[curRow][temp] === ' ') temp = (temp - 1 < 0) ? input[curRow].length - 1 : temp - 1;
        if (input[curRow][temp] === '#') break;
        curCol = temp;
        moves--;
    }
};

const moveRight = (amt) => {
    let moves = amt;
    while (moves > 0){
        let temp = curCol + 1;
        if (temp > input[curRow].length - 1) temp = 0;
        while (input[curRow][temp] === ' ') temp = (temp + 1 > input[curRow].length - 1) ? 0 : temp + 1;
        if (input[curRow][temp] === '#') break;
        curCol = temp;
        moves--;
    }
};

const getSolution = () => {
    return (1000*(curRow + 1)) + (4*(input[curRow].filter(e => e !== ' ').findIndex(e => e === 'X') + 1)) + curDir;
};

const traverse = () => {
    for (const inst of instructions){
        if (typeof inst === 'string') {
            changeDir(inst);
            continue;
        }
        switch(curDir){
            case 0:
                moveRight(inst);
                break;
            case 1:
                moveDown(inst);
                break;
            case 2:
                moveLeft(inst);
                break;
            case 3:
                moveUp(inst);
                break;
        };
    }
    input[curRow][curCol] = 'X';
};

traverse();
